import React from 'react';
import './style.css';

function ContactPage() {
  return (
    <div>
      <table>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>Phone Number</th>
        </tr>
        <tr>
          <td>Khulood Yousuf Al Nuaimi</td>
        </tr>
      </table>
    </div>
  )
}

export default ContactPage;
